import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class ReactApp extends Component {

  render() {
    let title = this.props.title
    let text = this.props.children

    return(
      <div>
        <h3>{title}</h3>
        <h5>{text}</h5>
      </div>
    );
  }
}

ReactApp.propTypes = {

  title: PropTypes.string.isRequired
}
